import React from "react";
import './Header.css'
import '../../styles/custom.css';


export const Header = () =>
{

    return(

        // header  

        <header id ="header" className="header d-flex align-items-center justify-content-between">

        {/*main header*/}
        
            <div className="header-content d-flex align-items-center">
                <div className="d-flex justify-content-start align-items-center">
                    <img src="https://th.bing.com/th/id/R.eff0e05f4ed2b9cffb53dda091b69695?rik=dcOInyVW7kRCmQ&riu=http%3a%2f%2flogos-download.com%2fwp-content%2fuploads%2f2016%2f10%2fDeloitte_logo_black.png&ehk=uuFrsu8aPXQ2TGMxfvemYhLjxqGDOzwhwNlqGJ0n%2bF8%3d&risl=&pid=ImgRaw&r=0"
                    className="deloitte-logo-image"
                    alt="deloitte_logo"/>
                </div>
                
            </div>

        {/*sub header*/}

            <div className="subheader1 d-flex align-items-center justify-content-between">
                <div className="d-flex justify-content-start align-items-center">
                    <div className="subheader__text align-items-center"> 
                        Quiz Box Android
                    </div>
                </div>
            </div>

        {/*user initials*/}

        </header>
    )
}
